void HealthCenter_Main(ObjectMaster* a1)
{
	if (a1->Data1->Action == 0) 
	{
		int hasIllness = -1;
		if (ChaoDataPtr)
			for (int i = 0; i < 6; i++)
			{
				if (ChaoDataPtr->data.Emotion.IllState[i] < 0)
					hasIllness = i;
			}
		else 
			hasIllness = -1;
				
		if (hasIllness >= 0)
			a1->Data1->Object = (NJS_OBJECT*)CreateDrugDisplay(a1);
		else a1->Data1->Action++;

		a1->Data1->Action++;
	}
	else if (a1->Data1->Action == 1)
	{
		if (((ObjectMaster*)a1->Data1->Object)->Data1->Action == 4) {
			a1->Data1->Action++;
			int hasIllness = -1;
			if (ChaoDataPtr)
			{
				for (int i = 0; i < 6; i++)
				{
					if (ChaoDataPtr->data.Emotion.IllState[i] < 0)
						hasIllness = i;
				}
				ChaoDataPtr->data.Emotion.IllState[hasIllness] = 100;
			}
			
		}
	}
	else if (a1->Data1->Action == 2)
	{
		
		SetNextChaoLevel(GetLastChaoStage());
		//LoadNextChaoStage();
	}
	RunObjectChildren(a1);
}

